import React, { useState } from "react";

const SignUpPage = () => {
  const [isSignUp, setIsSignUp] = useState(false);
  const [showPassword, setShowPassword] = useState(false);

  return (
    <div style={styles.container}>
      {/* Left Section: Dynamic (Login or Sign-Up) */}
      <div style={styles.leftSection}>
        {isSignUp ? (
          <>
            <h2 style={styles.title}>Create an Account</h2>
            <div style={styles.inputContainer}>
              <input type="text" placeholder="Full Name" style={styles.input} />
              <input type="email" placeholder="Email" style={styles.input} />
              <div style={styles.inputWrapper}>
                <input
                  type={showPassword ? "text" : "password"}
                  placeholder="Password"
                  style={styles.input}
                />
                <span
                  style={styles.eyeIcon}
                  onClick={() => setShowPassword(!showPassword)}
                >
                  {showPassword ? "üôà" : "üëÅÔ∏è"}
                </span>
              </div>
            </div>
            <button style={styles.signInButton} onClick={() => setIsSignUp(false)}>
              SIGN UP
            </button>
          </>
        ) : (
          <>
            <h2 style={styles.title}>Login to Your Account</h2>
            <div style={styles.inputContainer}>
              <input type="email" placeholder="Email" style={styles.input} />
              <div style={styles.inputWrapper}>
                <input
                  type={showPassword ? "text" : "password"}
                  placeholder="Password"
                  style={styles.input}
                />
                <span
                  style={styles.eyeIcon}
                  onClick={() => setShowPassword(!showPassword)}
                >
                  {showPassword ? "üôà" : "üëÅÔ∏è"}
                </span>
              </div>
            </div>
            <button style={styles.signInButton} onClick={() => setIsSignUp(true)}>
              SIGN IN
            </button>
          </>
        )}
      </div>

      <div style={styles.divider}></div>

      {/* Right Section: Static */}
      <div style={styles.rightSection}>
        {isSignUp ? (
          <>
            <h1 style={styles.signupTitle}>Already have an account?</h1>
            <button style={styles.signUpButton} onClick={() => setIsSignUp(false)}>
              SIGN IN
            </button>
          </>
        ) : (
          <>
            <h1 style={styles.signupTitle}>New Here?</h1>
            <h2 style={styles.signupText}>Sign up and explore new features!</h2>
            <button style={styles.signUpButton} onClick={() => setIsSignUp(true)}>
              SIGN UP
            </button>
          </>
        )}
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
    width: "100vw",
    background: "#FFFFFF",
    fontFamily: "'Poppins', sans-serif",
  },
  leftSection: {
    flex: 2,
    padding: "40px",
    textAlign: "center",
  },
  rightSection: {
    flex: 1,
    padding: "40px",
    textAlign: "center",
    background: "linear-gradient(135deg, #B1B695, #53917E)",
    color: "white",
    height: "100vh",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
  },
  title: {
    fontSize: "26px",
    fontWeight: "bold",
    color: "#53917E",
  },
  inputContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: "10px",
  },
  inputWrapper: {
    display: "flex",
    alignItems: "center",
    background: "#f9f9f9",
    borderRadius: "8px",
    padding: "10px",
    width: "300px",
    border: "1px solid #ddd",
    position: "relative",
  },
  input: {
    width: "100%",
    border: "none",
    background: "transparent",
    outline: "none",
    fontSize: "14px",
  },
  eyeIcon: {
    position: "absolute",
    right: "10px",
    cursor: "pointer",
    fontSize: "18px",
  },
  signInButton: {
    width: "300px",
    padding: "12px",
    marginTop: "15px",
    background: "linear-gradient(135deg, #B1B695, #53917E)",
    color: "white",
    border: "none",
    borderRadius: "30px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "bold",
    transition: "transform 0.3s ease-in-out, background 0.3s ease-in-out",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
  },
  signUpButton: {
    width: "300px",
    padding: "12px",
    marginTop: "15px",
    background: "#fff",
    color: "#53917E",
    border: "none",
    borderRadius: "30px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "bold",
    transition: "transform 0.3s ease-in-out, background 0.3s ease-in-out",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
  },
  divider: {
    width: "2px",
    background: "#B1B695",
    height: "100vh",
  },
  signupTitle: {
    fontSize: "28px",
    marginBottom: "10px",
  },
  signupText: {
    fontSize: "18px",
    margin: "0 30px",
  },
};

export default SignUpPage;
